import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import logo from 'F:\\Medic Aide\\medicaide\\src\\Medic aide.png';
import './LoginDoctor.css';


function Copyright(props) {
  return (
    <Typography variant="body2" color="text.secondary" align="center" {...props}>
      {'Copyright © '}
      <Link color="inherit" href="https://mui.com/">
        Medic Aide
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

// TODO remove, this demo shouldn't need to reset the theme.

const defaultTheme = createTheme();

export default function LoginDoctor() {
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    console.log({
      Patid: data.get('Patid'),
      password: data.get('password'),
    });
  };

  return (
      <ThemeProvider theme={defaultTheme}>
      <div class='logo'>
        <img src={logo} width={100} height={100}></img>
      </div>
      <Container component="main" maxWidth="xs" class='bg'>
        <CssBaseline />
        <Box
          sx={{
            marginTop: 0,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
        <Grid class='boxa' sx={{
            
          }}>
        <Avatar src="/broken-image.jpg" sx={{mt:17}}/>
          <Typography component="h1" variant="h5">
            Doctor
          </Typography>
          <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 15 }}>
            <TextField
              margin="normal"
              required
              fullWidth
              id="Patid"
              label="Patient ID"
              name="Patid"
              autoComplete="Patid"
              autoFocus
            />
            <TextField
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
            />
            <FormControlLabel
              control={<Checkbox value="remember" color="primary" />}
              label="Remember me"
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
            >
              Login
            </Button>
            <Grid container>
              <Grid item xs>
                <Link href="#" variant="body2">
                  Forgot password?
                </Link>
              </Grid>
              <Grid item>
                <Link href="#" variant="body2">
                  {"Don't have an account? Sign Up"}
                </Link>
              </Grid>
            </Grid>
          </Box>
          </Grid>
        </Box>
        <Copyright sx={{ mt: 13.5, mb: 0 }} />
      </Container>
    </ThemeProvider>
  );
}
